import React from "react";
import BackButton from "./BackButton";
import Team1Button from "./Team1Button";
import Team2Button from "./Team2Button";

function Header() {
    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    <li><BackButton /></li>
                    <li><Team1Button /></li>
                    <li><Team2Button /></li>
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

export default Header;
